import './App.css';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Home from './pages/home'
import Top from './pages/top'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <nav>
          <Link to='/Home'>
            <button>Home</button>
          </Link>
          <div className="drop">
            <Link to='/Top'>
              <button>My Top 100 Movies</button>
            </Link>
          </div>

          {/*watchlist and watched*/}
        </nav>
      <Routes>
        <Route path="/" element={<Home/>}></Route>
        <Route path="/Top" element={<Top/>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
